INSERT INTO `busi_document` VALUES ('1445940554062','1445933697685','公司简介','','',NULL,NULL,'','','','',NULL,'',NULL,'<p style=\"white-space: normal;\"><span style=\"font-size: 14px;\">&nbsp;&nbsp;&nbsp;&nbsp;新开普电子股份有限公司2000年成立于郑州高新技术产业开发区，注册资本28544万元。公司专业致力于开发以智能卡及RFID技术为基础的各类行业应用解决方案,面向城市、校园、企事业以及银行和电信运营商，从事智能一卡通系统的平台软件、应用软件及各类智能卡终端的研发、生产、集成、销售和服务业务。2011年7月29日，公司登陆资本市场，成为中国一卡通领域首家上市公司，募集资金3.4亿元。公司现有员工1000余人，拥有1家控股子公司、2家参股子公司及5家分公司，并在全国30余个大、中城市设立了驻外服务机构。</span></p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal;\"><span style=\"font-size: 14px;\">&nbsp;&nbsp;&nbsp;&nbsp;作为国家重点支持的高新技术企业和火炬计划重点高新技术企业，新开普共获得150余项专利及软件著作权；公司以完善行业应用平台建设为支撑，形成综合的多行业应用服务能力，以智能终端创新为基础，提高智能终端核心技术开发及产业化能力,以移动互联网关键技术的研发及应用为着力点，形成综合的移动互联网产业服务能力，为用户提供教育、市政、交通、金融、电信、移动、燃气、电力等行业线上与线下业务相融合的一卡通整体解决方案。</span></p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal;\"><span style=\"font-size: 14px;\">&nbsp;&nbsp;&nbsp;&nbsp;近年来，公司先后通过了CMMI L4级认证，ISO9001质量体系、ISO14001环境管理体系和OHSAS18001职业健康安全管理体系认证，公司被中国软件协会评定为AAA级最高信用资质。公司“湖南省金融IC卡行业应用综合服务平台项目”获得工信部颁发的“国家金卡工程优秀成果金蚂蚁奖”，“正普智能卡密钥管理系统” 获得2012中国年度创新软件产品。公司连续两年荣登“福布斯中国最佳潜力企业”。</span></p><p style=\"white-space: normal;\"><br/></p><p style=\"white-space: normal;\"><span style=\"font-size: 14px;\">&nbsp;&nbsp;&nbsp;&nbsp;随着移动浪潮的到来，公司以多年来积累的行业经验为基础，融合行业应用，快速推进移动互联和移动支付在行业中的普及，促进以大数据、移动互联以及智能终端为核心的O2O闭环模式的整合与发展，推进信息化产业的健康可持续发展。</span></p><p><br/></p>','default/single',''),('1445944340585','1445933793433','公司历史','','',NULL,NULL,'','','','',NULL,NULL,NULL,'<p style=\"margin-right: 10px; margin-left: 34px; padding: 0px; line-height: 24px; font-size: 12px; color: rgb(85, 85, 85); font-family: Arial, Helvetica, sans-serif; white-space: normal;\"><strong style=\"margin: 0px; padding: 0px; color: rgb(255, 0, 0); font-size: 14px;\">2013年</strong></p><p style=\"margin-right: 10px; margin-left: 34px; padding: 0px; line-height: 24px; font-size: 12px; color: rgb(85, 85, 85); font-family: Arial, Helvetica, sans-serif; white-space: normal;\">1月9日，公司再次荣登福布斯《中国潜力企业榜》榜单，位列2012年度 “最具潜力上市企业”第33位。<br style=\"margin: 0px; padding: 0px;\"/>1月14日，河南省信用建设促进会授予公司首批“河南省信用建设示范单位”荣誉称号。<br style=\"margin: 0px; padding: 0px;\"/>1月29日，公司入选“2012年度河南省物联网十强企业”。<br style=\"margin: 0px; padding: 0px;\"/>4月16日，公司荣获中国信用建设促进委员会颁发的“中国信用共建2012年度重信用企业”。<br style=\"margin: 0px; padding: 0px;\"/>6月4日，公司 “安徽电信翼机通集中平台”获得国家金卡工程2013年度金蚂蚁奖优秀应用成果奖。</p><p style=\"margin-right: 10px; margin-left: 34px; padding: 0px; line-height: 24px; font-size: 12px; color: rgb(85, 85, 85); font-family: Arial, Helvetica, sans-serif; white-space: normal;\"><strong style=\"margin: 0px; padding: 0px; color: rgb(255, 0, 0); font-size: 14px;\">2012年</strong></p><p style=\"margin-right: 10px; margin-left: 34px; padding: 0px; line-height: 24px; font-size: 12px; color: rgb(85, 85, 85); font-family: Arial, Helvetica, sans-serif; white-space: normal;\">1月13日，公司被科学技术部火炬中心认定为“国家火炬计划软件产业基地郑州软件园骨干企业”；<br style=\"margin: 0px; padding: 0px;\"/>2月17日，公司完成对外贸易经营者备案登记工作；<br style=\"margin: 0px; padding: 0px;\"/>2月20日，郑州市人力资源和社会保障局授予公司“2011年度郑州市人力资源和社会保障工作先进单位”；<br style=\"margin: 0px; padding: 0px;\"/>2月26日，河南省工业和信息化厅认定公司为“软件和信息服务业20优企业”；<br style=\"margin: 0px; padding: 0px;\"/>3月15日，公司荣登福布斯2012中国最具潜力企业榜；<br style=\"margin: 0px; padding: 0px;\"/>6月，“郑州新开普电子股份有限公司实施质量总体解决方案（TSQ）的实践经验”被工信部评定为：2012年度全国“质量标杆”。<br style=\"margin: 0px; padding: 0px;\"/></p><p style=\"margin-right: 10px; margin-left: 34px; padding: 0px; line-height: 24px; font-size: 12px; color: rgb(85, 85, 85); font-family: Arial, Helvetica, sans-serif; white-space: normal;\"><strong style=\"margin: 0px; padding: 0px; color: rgb(255, 0, 0); font-size: 14px;\">2011年</strong></p><p style=\"margin-right: 10px; margin-left: 34px; padding: 0px; line-height: 24px; font-size: 12px; color: rgb(85, 85, 85); font-family: Arial, Helvetica, sans-serif; white-space: normal;\">1月5日，公司上市首发申请材料正式获中国证监会受理；<br style=\"margin: 0px; padding: 0px;\"/>1月，公司由河南省工业和信息化厅授予 “河南省高技术工业60强企业”；<br style=\"margin: 0px; padding: 0px;\"/>3月22日，公司由郑州市人力资源和社会保障局授予“郑州市劳动关系和谐模范企业”称号；<br style=\"margin: 0px; padding: 0px;\"/>6月9日，中国证券监督管理委员会创业板发行监管部公布我公司（首发）获通过；<br style=\"margin: 0px; padding: 0px;\"/>6月25日，公司“基于物联网应用的系列智能终端与信息系统建设项目”顺利奠基；<br style=\"margin: 0px; padding: 0px;\"/>7月 7日，我公司首次公开发行股票并在创业板上市获得中国证监会的核准；<br style=\"margin: 0px; padding: 0px;\"/>7月29日，公司股票在深圳证券交易所创业板挂牌上市；<br style=\"margin: 0px; padding: 0px;\"/>7月25日，公司获得由郑州市委、郑州市人民政府颁发的“郑州市高成长型民营企业”荣誉称号；<br style=\"margin: 0px; padding: 0px;\"/>9月15日，公司被中国银行股份有限公司河南省分行授予“总行级中小企业重点客户”；<br style=\"margin: 0px; padding: 0px;\"/>9月24日，公司获得由中国信息协会颁发的“2011中国城市信息化产品创新奖”；<br style=\"margin: 0px; padding: 0px;\"/>11月16日，公司携“智慧城市”解决方案亮相深圳第十三届高交会，获得由国家发展和改革委员会颁发的“优秀展示奖”和中国国际高新技术成果交易会组委会颁发的“优秀产品证书”；<br style=\"margin: 0px; padding: 0px;\"/>11月29日，公司在2011中国移动支付产业年会上荣获“2011年度移动支付产业优秀方案奖”；</p><p style=\"margin-right: 10px; margin-left: 34px; padding: 0px; line-height: 24px; font-size: 12px; color: rgb(85, 85, 85); font-family: Arial, Helvetica, sans-serif; white-space: normal;\"><strong style=\"margin: 0px; padding: 0px; color: rgb(255, 0, 0); font-size: 14px;\">2010年</strong></p><p style=\"margin-right: 10px; margin-left: 34px; padding: 0px; line-height: 24px; font-size: 12px; color: rgb(85, 85, 85); font-family: Arial, Helvetica, sans-serif; white-space: normal;\">1月，公司成立生产、研发、营销、客服中心，组织架构更加完善；<br style=\"margin: 0px; padding: 0px;\"/>10月，公司取得了由工业和信息化部颁发的《增值电信业务经营许可证》；<br style=\"margin: 0px; padding: 0px;\"/>12月，公司被科学技术部火炬高技术产业开发中心评为“国家火炬计划重点高新技术企业”；</p><p style=\"margin-right: 10px; margin-left: 34px; padding: 0px; line-height: 24px; font-size: 12px; color: rgb(85, 85, 85); font-family: Arial, Helvetica, sans-serif; white-space: normal;\"><strong style=\"margin: 0px; padding: 0px; color: rgb(255, 0, 0); font-size: 14px;\">2009年</strong></p><p style=\"margin-right: 10px; margin-left: 34px; padding: 0px; line-height: 24px; font-size: 12px; color: rgb(85, 85, 85); font-family: Arial, Helvetica, sans-serif; white-space: normal;\">6月19日，经河南省科技厅批准,公司成立“河南省智能卡与射频识别应用工程技术研究中心”；<br style=\"margin: 0px; padding: 0px;\"/>6月26日，经郑州市科技局批准，公司成立“郑州市企业技术中心”；<br style=\"margin: 0px; padding: 0px;\"/>12月12日，公司取得由工业和信息化部颁发的计算机系统集成二级资质；新开普CPU校园一卡通系统在河南大学成功实施；</p><p style=\"margin-right: 10px; margin-left: 34px; padding: 0px; line-height: 24px; font-size: 12px; color: rgb(85, 85, 85); font-family: Arial, Helvetica, sans-serif; white-space: normal;\"><strong style=\"margin: 0px; padding: 0px; color: rgb(255, 0, 0); font-size: 14px;\">2008年</strong></p><p style=\"margin-right: 10px; margin-left: 34px; padding: 0px; line-height: 24px; font-size: 12px; color: rgb(85, 85, 85); font-family: Arial, Helvetica, sans-serif; white-space: normal;\">4月，通过CMMI L3认证，成为河南省首家同时也是一卡通行业首家通过CMMI L3认证的企业<br style=\"margin: 0px; padding: 0px;\"/>5月，公司正式更名为郑州新开普电子股份有限公司<br style=\"margin: 0px; padding: 0px;\"/>10月，中标山东淄博城市一卡通项目，正式进入城市一卡通领域。</p><p><br/></p>','default/single',''),('1445947810718','1445933824290','联系我们','','',NULL,NULL,'','','','',NULL,'',NULL,'<p style=\"margin: 0px 10px 20px 30px; padding: 0px; line-height: 22px; font-family: Arial, Helvetica, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(254, 254, 254);\"><strong style=\"margin: 0px; padding: 0px;\">新开普电子股份有限公司</strong><br style=\"margin: 0px; padding: 0px;\"/>地址：郑州市高新技术产业开发区迎春街18号</p><p style=\"margin: 0px 10px 20px 30px; padding: 0px; line-height: 22px; font-family: Arial, Helvetica, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(254, 254, 254);\"><strong style=\"margin: 0px; padding: 0px;\">全国统一服务热线</strong>：4006 300248</p><p style=\"margin: 0px 10px 20px 30px; padding: 0px; line-height: 22px; font-family: Arial, Helvetica, sans-serif; font-size: 12px; white-space: normal; background-color: rgb(254, 254, 254);\"><strong style=\"margin: 0px; padding: 0px;\">销售热线</strong><br style=\"margin: 0px; padding: 0px;\"/>电话：4006300248转1</p><p style=\"margin: 0px 10px 20px 30px; padding: 0px; line-height: 22px; font-family: Arial, Helvetica, 